fields.description:
I was trying to create a launch configuration (LC) from an existing one on the LC landing page.  After I completed the 'Create launch configuration like' wizard, I was immediately logged out.  I tried to go back to the LC landing page.  Each time I tried to access the LC page, I was logged out.  I am also getting this error message in the eucaconsole.log file:
{code}
2015-06-22 16:37:09 ERROR ui-test-acct-00/admin@10.5.1.46 [Pzw1J9N5bfeOtZlA]: The image 'emi-60daf9a5' does not exist
{code}
I double-checked that image and it does exist.  I have attached a screen shot of the LC that I am trying to use.  I have also attached a video of the behavior.

The work-around is to use the CLI.  From the CLI, I was able to see the new LC was created and does exist.  If I delete the newly created LC from the CLI, I can access the launch configuration landing page again.
